 Yeah, that&#39;s what I meant, coughing, gagging and snoring, I have to wear e=
ar plugs! I used to be able to go to the other room, but then the grand kid=
s moved in, and no more spare room. I have been in that paralyzed state a f=
ew times, but only one conscious projection. I can get close though, even t=
o the point of seeing through my eyelids! I think I still have a fear block=
 of actually leaving the body. 





 Frank



_________________________=
_______

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On =
Behalf Of Andrea Carr
Sent: Thursday, July 20, 2006 3:29 PM
To: EVP-ITC@yah=
oogroups.com
Subject: RE: [EVP-ITC] One more quake voice



Really I haven=
&#39;t ever woken up while leaving but when coming back and woke up in almost a=
 half awake state feeling trapped because I couldn&#39;t move until I shook it =
off.



Well it depends on what you mean about your wife not being gone lo=
ng enough-LOL my hubby can snore really badly and I have had to go in anoth=
er room to sleep. I should have him get that checked though.





Andrea
=



