 I read that in one of my Astral books, but have never tried it.=
 Everytime I get close, the process of leaving breaks my awareness, and I&#39;m=
 instantly awake. I had started to work on astral projection again when the=
 wife was in the hospital, but she wasn&#39;t in long enough (cold!?). 





=




